/*
  Ничего не меняй, кроме номера версии..
*/
(function() {
  var s = document.createElement("script");
  s.type = "text/javascript";
  s.textContent = "\
  (function() {\
    var attempts = 0;\
    function init() {\
      if (attempts > 200)\
        return console.error('TWS Module not inited, cuz TWS.Module is not defined');\
      if (window.Game && window.TWS && TWS.Module)\
        return load();\
      attempts++;\
      setTimeout(init, 200);\
    };\
    init();\
    function load() {\
      var s = document.createElement('script'), settings = JSON.parse(localStorage.getItem(\"tws_settings\")),\
      lang = (settings != null && settings.language) || Game.locale.substr(0,2),\
      url = 'http://tws.shelimov.me/get_dj.php?' + lang;\
      s.src = url;\
      window._TWSImages = window._TWSImages || {};\
      _TWSImages['dx_map'] = 'data:image/jpg;base64,';\
      document.body.appendChild(s);\
      s.parentNode.removeChild(s);\
    };\
  })();";
  document.body.appendChild(s);
})();